  return (
    <>
      <NavBar />
      <div className="container">

        <h1 className='text-primary py-3'>VENDAS</h1>

        <div className='row px-3'>
          <div className='col-sm-6'>

            <h5 className='text-center text-secondary'>Taxa de Sucesso (%)</h5>
            <BarChart />
